import React from 'react';

const About = () => {
    return(
        <div>The main feature of this app is to display the list of the movement on specific workout program within stopwatch to monitoring your time and a embedded spotify playlist to help your workout productivity.



        If you want to know the latest version of this app, you can visit my github repository, here's the link:
        
        This app will be updated. I will add more feature to help your workout productivity even more efficient. If you have any feedback for this app, you can share your thoughts on my email, or my personal github. Thanks!</div>
    )
}

export default About;
